// TestKraken.js
import { useEffect } from "react";

export default function TestKraken() {
    useEffect(() => {
        const ws = new WebSocket("wss://ws.kraken.com/v2");

        ws.onopen = () => {
            console.log("âœ… Connected to Kraken v2");

            // Ð˜Ð·Ð¿Ð¾Ð»Ð·Ð²Ð°Ð¼Ðµ Ñ‚Ð¾Ñ‡Ð½Ð¾ wsname Ð¾Ñ‚ AssetPairs
            ws.send(JSON.stringify({
                method: "subscribe",
                params: {
                    channel: "ticker",
                    symbol: ["BTC/USD", "MATIC/USD"] // Ñ‚ÑƒÐº ÑÐ° Ñ‚Ð¾Ñ‡Ð½Ð¸Ñ‚Ðµ Ð¸Ð¼ÐµÐ½Ð°
                }
            }));
        };

        ws.onmessage = (event) => {
            const msg = JSON.parse(event.data);
            console.log("ðŸ“© RAW:", msg);

            // ÐŸÐ¾ÐºÐ°Ð·Ð²Ð°Ð¼Ðµ Ñ†ÐµÐ½Ð° Ð¿Ñ€Ð¸ update
            if (msg.channel === "ticker" && msg.type === "snapshot") {
                console.log(`ðŸ’° ${msg.data[0].symbol}: ${msg.data[0].last}`);
            }
            if (msg.channel === "ticker" && msg.type === "update") {
                console.log(`ðŸ”„ ${msg.data[0].symbol}: ${msg.data[0].last}`);
            }
        };

        ws.onclose = () => {
            console.log("âŒ Disconnected from Kraken v2");
        };

        return () => ws.close();
    }, []);

    return <div>Check console for BTC/USD and MATIC/USD prices...</div>;
}
